/**
 * @author lhornet
 * @date 12.04.2015
 * @doc module
 * @name cart
 * @description 
 * Shopping cart
 *
 * @injections jquery 1.7.2 or older, masked plugin
 */
(function () {
    'use strict';

    $(document).ready(function () {

        //checking inkognito & localstorage support
       /* function webStorage() {
            try {
                localStorage.setItem("test", "tested");
                return !!localStorage.getItem("test");
            } catch (e) {
                return false;
            }
        }*/

        $('.message').hide();

        //mask
        var
            i1 = $('input[name=input_name]'),
            i2 = $('input[name=input_product_phone]').mask("+38(999) 999 99 99"),
            i3 = $('input[name=input_phone]').mask("+38(999) 999 99 99"),
            i4 = $('.try30day-phone').mask("+38(999) 999 99 99"),
            //vars
            products = [],
            //submit = $('.btn-product').attr('disabled', 'disabled'),
            submit = $('.btn-product'),
            i = 0,
            sum = 0,
            totalSum = 0;

        /*modal popup redirect to full version*/

        /*if (webStorage() === false) {
            $('.popup').show();
        } else {
            localStorage.removeItem("test");
        }*/
        
        function returnProductArray(){
            
            var arr = [];

            for (var i = 0; i < localStorage.length; i++) {
                var
                    key = localStorage.key(i),
                    pos = key.indexOf("3gstar");

                if(pos !== -1){
                   arr.push(key);
                }

            }
            return arr;
        }

        function checkProductsId(check_id){
            var arr = returnProductArray();
            if(arr.indexOf(check_id) !== -1){
               var d = localStorage.getItem(check_id),
                   data = JSON.parse(d);
                return data[0].count;
            }else{return false;}

        }

        //add to cart from product template
        $('.buy_button').on({
            click:
                function (e) {
                   // e.preventDefault();
                    if (localStorage.length > 0) {
                        var 
                            id = $(this).attr('data-id'),
                            checkId = checkProductsId(id), 
                            counter = 0;
                        
                        if(checkId === false){counter = $(this).attr('data-count');
                        }else{counter = (+checkId)+1;}
                        
                        var product = {
                               id: $(this).attr('data-id'),
                               name: $(this).attr('data-name'),
                               description: $(this).attr('data-description'),
                               image: $(this).attr('data-image'),
                               price: $(this).attr('data-price'),
                               sum: ($(this).attr('data-price')) * (counter),
                               count: counter,
                               params: $(this).attr('data-params')
                        };

                        products.push(product);
                        localStorage.setItem(product.id, JSON.stringify(products));
                        console.log("localStorage", localStorage);
                    }
                }
        });

        //redraw cart
        function drawCart() {

            var arr = [],
                debug = [];
                console.log(localStorage);
                
            for (var i = 0; i < localStorage.length; i++) {
                var
                    key = localStorage.key(i),
                    pos = key.indexOf("3gstar_"),
                    /*debugger*/
                    item = localStorage.getItem(key);
                   // if(pos !== -1){
                        var str = "<strong>"+key+"</strong>  "+item+"<br/>";
                  //  }
                    
                    debug.push(str);
                    /*end debugger*/
					
                if(pos !== -1){
                     arr.push(key);
                }
            }
			
            /*debugger*/
            if(debug !==null){
                    $('p.local_debug').html(debug);
            }else{
                    $('p.local_debug').html('empty');
            }
            /*end debugger*/
			
            var output = "";
            $(".ordering .row.first-order").remove();
            if(arr.length > 0){
                for (var i = 0; i <  arr.length; i++) {
                    $('.feedback-form').show();
  
                    var d = localStorage.getItem(arr[i]);
                    var data = JSON.parse(d);

                    console.log("data",data);

                    totalSum += data[0].sum;
                    var aa = data[0].params.split(',');

                    output +=
                            "<div class = 'row first-order'>"  +
                            "<div class='col-xs-4'>" +
                            "<img src=" + data[0].image + " class='img-responsive'>" +
                            "</div>" +
                            "<div class='col-xs-6'> " +
                            "<h2>" + data[0].name + "</h2>" +
                            "<div class='form-group' data-id=" + data[0].id + " data-price=" + data[0].price + ">" +
                            "<input 							" +
                            "	type='tel'						" +
                            "	value=" + data[0].count + " 		" +
                            "	class='checkout_shop'			" +
                            ">" +
                            "</div>" +
                            "<div class='price pr_cart'>" +
                            "<p>" + data[0].sum + "<span>грн</span></p>" +
                            "</div> " +
                            "</div> " +
                            "<div class='col-xs-2'>" +
                            "<img src='img/close.png' class='img-responsive delete-item'>" +
                            "</div>" +
                            "</div> ";
                    }
                    output += "<div class='price pr_cart'><p>Всего: " + totalSum + " грн</p></div>";
                } else {
                    
                    output = "Ваша корзина пуста";
                    $('.feedback-form').hide();
                }

            $(".ordering").html(output);
            totalSum = 0;
        }
        drawCart();

        //change qty item in cart
        $(document.body).on('keyup', '.checkout_shop',
                function (e) {

                    i++;
                    var parent = $(this).parents('.first-order'),
                            countItems = $(this).val(),
                            id = parent.find('.form-group').attr('data-id'),
                            price = parent.find('.form-group').attr('data-price'),
                            d = localStorage.getItem(id),
                            data = JSON.parse(d),
                            sumItems = price * countItems;

                    if (countItems >= 1) {
                        var product = {
                            id: data[0].id,
                            name: data[0].name,
                            description: data[0].description,
                            image: data[0].image,
                            price: data[0].price,
                            count: countItems,
                            sum: sumItems,
                            params: data[0].params
                        };

                        if (i <= 1)
                        {
                            products.push(product);
                            localStorage.setItem(id, JSON.stringify(products));
                        } else {
                            localStorage.setItem(id, JSON.stringify([product]));
                        }

                        drawCart();
                    }
                }
        );

        //delete item in cart
        $(document.body).on('click', '.delete-item',
                function () {
                    var parent = $(this).parents('.first-order'),
                            iditem = parent.find('.form-group').attr('data-id');
                    removeItem(iditem);
                }
        );

        //show error message
        function showMessage(notice, name) {
            var message = $('.message.' + name);

            if (notice !== '') {
                message.show().html(notice);
            } else {
                message.hide();
            };
        }

        //validate fields
        function validate(value, field) {

            var
                messages = {
                    Number: 'Необходимо вводить числа',
                    Required: 'Заполните, пожалуйста, все поля.',
                    Name: 'Необходимо вводить символы'
                },
                reg = /[0-9]/,
                regChar = /[A-Za-zА-Яа-я]/,
                rules = {
                    isNumber: function (val) {
                        if (reg.test(val)) {
                            $('.message').hide();
                            return true;
                        } else {
                            showMessage(messages.Number, 'phone');
                            return false;
                        }
                    },
                    required: function (val) {
                        if (val !== '') {
                            $('.message').hide();
                            return true;
                        } else {
                            showMessage(messages.Required, 'required');
                            return false;
                        }
                    },
                    /*isPhone:function(val){},*/
                    isName: function (val) {
                        if (regChar.test(val)) {
                            $('.message').hide();
                            return true;
                        } else {
                            showMessage(messages.Name, 'name');
                            return false;
                        }
                    }
            };

            switch (field) {
                case 'add_to_cart':
                    rules.isName(value);
                    rules.required(value);
                    break;
                case 'checkout':
                    if (rules.required(value) && rules.isName(value)){return true;}
                    break;
                case 'required':
                    if (rules.required(value)) {return true;}
                    break;
                case 'recount':
                    rules.isNumber(value);
                    rules.required(value);
                default: '';
            }
        }

        //remove item
        function removeItem(id) {
            localStorage.removeItem(id);
            drawCart();
        }

        //clear Storage
        function clearCart() {
            localStorage.clear();
        }

        //check form
        $('input[name=input_name],input[name=input_phone]').keyup(function () {
            ckeckSubmit();
        });
        
        //check submit
        function ckeckSubmit() {
            var
                a1 = i1.val(),
                a3 = i3.val(),
                form = {
                    name: a1,
                    phone: a3
                };

            if (validate(a1, 'checkout') && validate(a3, 'required')) {
                submit.removeAttr('disabled');
                return form;
            } else {
                submit.attr('disabled', 'disabled');
            }
        }

        //checkout
        $('.btn-product').click(
            function (e) {
                e.preventDefault();
                ckeckSubmit();
                var 
                    submit = ckeckSubmit(),
                    orders = [],
                    total = [],
                    arr = returnProductArray(),
                    user = [];
            
                    console.log("data all: ", arr);
                    
                    for (var i = 0; i < arr.length; i++) {
                        
                        var 
                            d = localStorage.getItem(arr[i]),
                            data = JSON.parse(d);

                            totalSum += data[0].sum;
                          
                          console.log("arr[i] ", arr[i]);
                         
                          console.log("data total: ", Object.keys(data[0].id).length);
                          
                    //    for (var i = 0; i < data.length; i++) {
                            console.log("data finish ", data[0].id);
                          //  if(data[0].name == arr[i]){
                                orders.push(data);
                          //  }
                   //     }
                    }

                    total.push({'total': totalSum});
                    user.push({
                        'userName': submit.name,
                        'userPhone': submit.phone
                    });

                    if (
                        orders !== null &&
                        total !== null &&
                        submit.name !== null &&
                        submit.name !== 'test' &&
                        submit.name !== 'Test' &&
                        submit.name !== 'тест' &&
                        submit.phone !== null
                    ) {
                        checkout(orders, total, user);
                    }else{
                        testCheckout(orders, total, user);
                    }
                
            }
        );

        //ajax checkout
        function checkout(order, total, user) {
            console.log('obj', order, total, user);
            
            $.ajax({
                url: 'http://m.3gstar.com.ua/ajax/ajax.php',
                type: 'post',
                data: {
                    order: order,
                    total: total,
                    user: user
                },
                success: function () {
                    alert('Спасибо, Ваш заказ оформлен');
                    clearCart();
                    drawCart();
                },
                error: function (data) {
                    console.log("error", data);
                    return;
                }
            });

        }
        
        //ajax checkout
        function checkout(order, total, user) {
            console.log('obj', order, total, user);
            
            $.ajax({
                url: 'http://m.3gstar.com.ua/ajax/ajax.php',
                type: 'post',
                data: {
                    order: order,
                    total: total,
                    user: user
                },
                success: function () {
                    alert('Спасибо, Ваш заказ оформлен');
                    clearCart();
                    drawCart();

                },
                error: function (data) {
                    console.log("error", data);
                    return;
                }
            });

        }

        function testCheckout(order, total, user) {
            console.log('obj', order, total, user);
            
            $.ajax({
                url: 'http://m.3gstar.com.ua/ajax/ajaxTest.php',
                type: 'post',
                data: {
                    order: order,
                    total: total,
                    user: user
                },
                success: function () {
                    alert('Спасибо, Ваш заказ оформлен');
                    clearCart();
                    drawCart();

                },
                error: function (data) {
                    console.log("error", data);
                    return;
                }
            });

        }

    });

})();
